import React from 'react';
import { Link } from 'react-router-dom';
import logo from './logo.svg';
function Header() {
  return (
    <header>
      <Link to="/">
        <img src={logo} alt="Tractian logo" />
      </Link>
    </header>
  );
}

export default Header;
